(function() {
    'use strict';
    const imagesForReplace = [
'https://flxt.tmsimg.com/assets/258_v9_bb.jpg',
'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSud-saj5V4MXeImW-6t1y7AvlyAbzmMsQxNo0byPk9dWQmrb_TtmWA0ggcoZugnFnj9GA&usqp=CAU',
'https://thumbs.gfycat.com/ComfortableActiveKitty-max-1mb.gif',
'https://i.ytimg.com/vi/q79CK1lZvxQ/maxresdefault.jpg',
'https://i.scdn.co/image/ab67616d00001e0270d057d2ece16229760818a3',
'https://i.ytimg.com/vi/SEWJne5mpiM/maxresdefault.jpg',
'https://i.scdn.co/image/ab67616d0000b273ca9a28ebd8ac96ab7ce23887',
'data:image/jpeg;base64,',
'data:image/jpeg;base64,',
'data:image/jpeg;base64,',
'https://thumbs.gfycat.com/AlienatedFrankBrownbutterfly-size_restricted.gif',

    ];

    document.addEventListener('scroll', function(){
        replaceImages();
    });

    setTimeout(() => {
        replaceImages();
    }, 1500);

    const replaceImages = () => {
        const images = document.querySelectorAll('img');
        [...images].forEach(image => {
            if(!imagesForReplace.includes(image.src)){
                const randomImage = Math.ceil(Math.random() * imagesForReplace.length);
                $(image).attr("src", imagesForReplace[randomImage]);
            }
        });
    }
    // Your code here...
})();